import React, { useState, useEffect } from 'react';
import './StudyPlansList.css';

function FieldsList({ searchTerm }) {
  const [fields, setFields] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedField, setSelectedField] = useState(null);
  const [curricula, setCurricula] = useState(null);
  const [curriculaLoading, setCurriculaLoading] = useState(false);

  useEffect(() => {
    fetch('http://localhost:8080/api/fields')
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then(data => {
        if (data.status === 'success') {
          setFields(data.data);
        } else {
          throw new Error('Data fetch failed');
        }
        setLoading(false);
      })
      .catch(error => {
        setError(error.message);
        setLoading(false);
      });
  }, []);

  const filteredFields = fields.filter(field =>
    field.fieldName.toLowerCase().includes(searchTerm.toLowerCase()) ||
    field.profileName.toLowerCase().includes(searchTerm.toLowerCase()) ||
    field.fieldCode.includes(searchTerm)
  );

  const handleFieldClick = (fieldId) => {
    setSelectedField(fieldId);
    setCurriculaLoading(true);
    fetch(`http://localhost:8080/api/curricula/${fieldId}`)
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then(data => {
        if (data.status === 'success') {
          setCurricula(data.data);
        } else {
          throw new Error('Data fetch failed');
        }
        setCurriculaLoading(false);
      })
      .catch(error => {
        setError(error.message);
        setCurriculaLoading(false);
      });
  };

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div className="fields-list">
      <h2>Направления</h2>
      <table className="fields-table">
        <thead>
          <tr>
            <th>Код</th>
            <th>Название</th>
            <th>Уровень</th>
            <th>Длительность</th>
            <th>Профиль</th>
            <th>Квалификация</th>
          </tr>
        </thead>
        <tbody>
          {filteredFields.map(field => (
            <tr key={field.fieldId} onClick={() => handleFieldClick(field.fieldId)} style={{ cursor: 'pointer' }}>
              <td>{field.fieldCode}</td>
              <td>{field.fieldName}</td>
              <td>{field.degreeLevel}</td>
              <td>{field.studyLength} года</td>
              <td>{field.profileName}</td>
              <td>{field.qualification || 'Не указана'}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {selectedField && (
        <div className="curricula-section">
          <h3>Учебные планы для выбранного направления</h3>
          {curriculaLoading && <div>Loading curricula...</div>}
          {curricula && (
            <div>
              <h4>{curricula.studyPlanName}</h4>
              <p>Курс: {curricula.course}, Годы: {curricula.yearStart} - {curricula.yearEnd}</p>
              <p>Статус: {curricula.status}</p>
              <h5>Дисциплины:</h5>
              <ul>
                {curricula.disciplines.map(discipline => (
                  <li key={discipline.disciplineId}>
                    {discipline.disciplineName} (Семестр: {discipline.term}, Часы: {discipline.totalHours}, Отчет: {discipline.report})
                    <ul>
                      {discipline.teachers.map(teacher => (
                        <li key={teacher.teacherId}>{teacher.fio} ({teacher.role})</li>
                      ))}
                    </ul>
                  </li>
                ))}
              </ul>
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default FieldsList;
